import React, { Component } from 'react';

class Message extends Component {

    constructor(){
        super()
        this.state = {
            message: 'Welcome Visitor'
        }
    }

    render() {
        return (
            <div>
                <h3>{this.state.message}</h3>
            </div>
        );
    }
}

export default Message;
